function openChat() {
 var linksChats = document.querySelectorAll(".js-chat");
  for (i = 0; i < linksChats.length; i++) {
    linksChats[i].addEventListener("click", function () {
      const blipClient = new BlipChat();
      blipClient
        .withAppKey(
          "b3V2aWRvcmlhcHJvZDplZjUxMDdiZi0xMGY3LTRiNDEtYjI2Yy0yYjUzMDliYTI5MmM="
        )
        .withAccount({ origem: "Site" })
        .withCustomCommonUrl("https://safra.chat.blip.ai/")
        .withButton({ color: "#5c6bc0" })
        .withCustomStyle(
          "#blip-chat-header,.blip-card .bubble.right,#message-input .send-button,#message-input .send-button:hover{background-color:#5c6bc0!important}"
        );

      blipClient.build();
      blipClient.toogleChat();
    });
  }
}

openChat();

